    and Prevention (CDC). State Tobacco Activities Tracking and Evaluation (STATE) System.
     E-Cigarette Legislationu00e2u0080u0094Licensure. The STATE System houses current
    and historical state-level legislative data on tobacco use prevention and control
    policies.  Data are reported on a quarterly basis. Data include information related
    to requirements, restrictions and penalties associated with holding a retail license
    to sell e-cigarettes over-the-counter and through vending machines.</p>n",nt"license_title":
